// Dependencies
import moment from 'moment';

// Styles
import { Box, Heading, SimpleGrid, Flex } from '@chakra-ui/core';

const HistoryList = ({ id, history, createdAt }) => {
  console.log('HistoryList History');
  console.log(history);

  return (
    <Box>
      <Flex justify="space-between">
        <Heading as="h1" size="lg">
          Order No. {id}
        </Heading>
        <Heading as="h1" size="lg">
          {createdAt}
        </Heading>
      </Flex>
    </Box>
  );
};

export default HistoryList;
